import { Container, Grid } from '@material-ui/core';
import React from 'react';
import Navbar from './Components/Navbar';

export default function App(){
    return (
       <Grid container direction = 'column'>
            <Grid item>
                <Navbar />
            </Grid>
            <Grid item container>
                <Grid item xs = {0} sm = {2}/>
                <Grid item xs = {12}  >
                    Content
                </Grid>
                <Grid item xs = {0} sm = {2}/>
            </Grid>
       </Grid>
    );
}
